function all(n,t){return[[-1/0,-1/0,1/0,1/0]]}function bbox(n,t){return[n]}function tile(i){return function(n,t){var t=i.getZForResolution(t),e=i.getTileRangeForExtentAndZ(n,t),o=[],r=[t,0,0];for(r[1]=e.minX;r[1]<=e.maxX;++r[1])for(r[2]=e.minY;r[2]<=e.maxY;++r[2])o.push(i.getTileCoordExtent(r));return o}}export{all,bbox,tile};